var groupAnagrams = function(strs) {
    const anagramGroups = new Map();
    for (const str of strs) {
        const sortedStr = str.split('').sort().join('');
        anagramGroups.set(sortedStr, (anagramGroups.get(sortedStr) || []).concat(str));
    }
    return Array.from(anagramGroups.values());
};

class Solution {
    public List<List<String>> groupAnagrams(String[] strs) {
        Map<String, List<String>> anagramGroups = new HashMap<>();

        for (String str : strs) {
            char[] charArray = str.toCharArray();
            Arrays.sort(charArray);
            String sortedStr = new String(charArray);

            anagramGroups.computeIfAbsent(sortedStr, k -> new ArrayList<>()).add(str);
        }

        return new ArrayList<>(anagramGroups.values());
    }
}

class Solution {

    /**
     * @param String $s
     * @return Integer
     */
    function lengthOfLongestSubstring($s) {
        $charMap = [];
        $left = 0;
        $maxLength = 0;

        for ($right = 0; $right < strlen($s); $right++) {
            $char = $s[$right];

            // If character is already in the window, move left pointer
            if (isset($charMap[$char]) && $charMap[$char] >= $left) {
                $left = $charMap[$char] + 1;
            }

            // Update character's last seen position
            $charMap[$char] = $right;

            // Update maximum length
            $maxLength = max($maxLength, $right - $left + 1);
        }

        return $maxLength;
    }
}

/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s) {
    const charSet = new Set();
    let left = 0;
    let maxLength = 0;

    for (let right = 0; right < s.length; right++) {
        // If character is already in set, move left pointer
        while (charSet.has(s[right])) {
            charSet.delete(s[left]);
            left++;
        }

        // Add current character to set
        charSet.add(s[right]);

        // Update maximum length
        maxLength = Math.max(maxLength, right - left + 1);
    }

    return maxLength;
};

class Solution {
    public int lengthOfLongestSubstring(String s) {
        int left = 0, right = 0;
        int maxLen = 0;
        Set<Character> seen = new HashSet<>();

        while (right < s.length()) {
            if (!seen.contains(s.charAt(right))) {
                seen.add(s.charAt(right));
                right++;
                maxLen = Math.max(maxLen, right - left);
            } else {
                seen.remove(s.charAt(left));
                left++;
            }
        }

        return maxLen;
    }
}

class Solution {

    /**
     * @param ListNode $l1
     * @param ListNode $l2
     * @return ListNode
     */
    function addTwoNumbers($l1, $l2) {
        $dummy = new ListNode(0);
        $current = $dummy;
        $carry = 0;

        while ($l1 !== null || $l2 !== null || $carry !== 0) {
            $sum = $carry;

            if ($l1 !== null) {
                $sum += $l1->val;
                $l1 = $l1->next;
            }

            if ($l2 !== null) {
                $sum += $l2->val;
                $l2 = $l2->next;
            }

            $carry = intval($sum / 10);
            $current->next = new ListNode($sum % 10);
            $current = $current->next;
        }

        return $dummy->next;
    }
}

